  <title>uk.ac.ebi.arrayexpress2.magetab.handler.visitor package</title>

<body>
Visitor classes that can be used to visit and inspect MAGE-TAB handlers. This is
used to extract interesting information about the state of a handler, which may
indicate something about a portion of the file (for example, the location of a
particular tag/value pair).
